  namespace: System.Diagnostics
  summary: "\n<p>Provides the default output methods and behavior for tracing.</p>\n"
  example:
  - "\n<p>The following code example calculates binomial coefficients, which are values used in probability and statistics. This example uses a <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref> to trace results and log errors. It creates a new <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref>, adds it to the <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> collection, and sets the <xref href=\"System.Diagnostics.DefaultTraceListener.LogFileName\" data-throw-if-not-resolved=\"false\"></xref> property to the log file specified in the command-line arguments.</p>\n<p>If an error is detected while processing the input parameter, or if the <code>CalcBinomial</code> function throws an exception, the <xref href=\"System.Diagnostics.DefaultTraceListener.Fail(System.String)\" data-throw-if-not-resolved=\"false\"></xref> method logs and displays an error message. If the <xref href=\"System.Diagnostics.DefaultTraceListener.AssertUiEnabled\" data-throw-if-not-resolved=\"false\"></xref> property is <strong>false</strong>, the error message is also written to the console. When the result is calculated successfully, the <xref href=\"System.Diagnostics.DefaultTraceListener.Write(System.String)\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"System.Diagnostics.DefaultTraceListener.WriteLine(System.String)\" data-throw-if-not-resolved=\"false\"></xref> methods write the results to the log file.</p>\n<p>The <xref href=\"System.Diagnostics.DefaultTraceListener.Fail(System.String)\" data-throw-if-not-resolved=\"false\"></xref>, <xref href=\"System.Diagnostics.DefaultTraceListener.Write(System.String)\" data-throw-if-not-resolved=\"false\"></xref>, and <xref href=\"System.Diagnostics.DefaultTraceListener.WriteLine(System.String)\" data-throw-if-not-resolved=\"false\"></xref> methods cause trace information to be written only to the <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref>. To write trace information to all listeners in the <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> collection, use the <xref href=\"System.Diagnostics.Trace.Fail(System.String)\" data-throw-if-not-resolved=\"false\"></xref>, <xref href=\"System.Diagnostics.Trace.Write(System.Object)\" data-throw-if-not-resolved=\"false\"></xref>, and <xref href=\"System.Diagnostics.Trace.WriteLine(System.Object)\" data-throw-if-not-resolved=\"false\"></xref> methods of the <xref href=\"System.Diagnostics.Trace\" data-throw-if-not-resolved=\"false\"></xref> class.</p>System.Diagnostics.DefaultTraceListener#11"
